css:
.show-todo-preview {
  background-color: #292c2f;
  color: #aaaaaa;
  overflow: scroll;
  padding: 10px;
}
.show-todo-preview .regex {
  color: #555555;
  font-size: 70%;
}
.show-todo-preview a {
  color: #4f99d3;
}
.show-todo-preview h1 {
  margin-bottom: 5px;
  font-weight: bold;
  overflow-wrap: break-word;
}
.show-todo-preview table {
  width: 100%;
  table-layout: fixed;
}
.show-todo-preview table td {
  padding: 10px 6px;
  overflow-wrap: break-word;
}
.show-todo-preview table td:nth-child(2n) {
  width: 33%;
}
.show-todo-preview table tr:nth-child(2n + 1) {
  background-color: #35393c;
}
